Here's a simple Python program that prints out the first 100 prime numbers using the Sieve of Eratosthenes algorithm, which is an efficient way to find all primes smaller than a given limit:

```python
def sieve_of_eratosthenes(limit):
    primes = []
    sieve = [True] * (limit + 1)
    for num in range(2, limit + 1):
        if sieve[num]:
            primes.append(num)
            for multiple in range(num * num, limit + 1, num):
                sieve[multiple] = False
    return primes

def main():
    limit = 10000  # Adjust the limit as needed to find more primes
    prime_numbers = sieve_of_eratosthenes(limit)
    print("The first 100 prime numbers are:")
    for num in prime_numbers[:100]:
        print(num, end=' ')

if __name__ == "__main__":
    main()
```

This program defines a `sieve_of_eratosthenes` function that generates all primes up to the given limit. The `main` function calls this function with an appropriate limit (10,000 in this case) and prints out the first 100 prime numbers. You can adjust the limit as needed to find more primes.

Note: This program may take a few seconds to run because it generates a large number of prime numbers.
